import ReactDOM from 'react-dom/client';
import MovieList from './components/MovieList';

const root = ReactDOM.createRoot(document.getElementById('root'));

let movies=fetch('https://api.themoviedb.org/3/discover/movie?api_key=a7eb658043f3997babdf4aee551d2350&language=en-US&sort_by=popularity.desc&include_adult=false&include_video=false&page=1&with_watch_monetization_types=flatrate')
.then((response) => response.json())
.then((data) => data.results);
root.render(
  <React.StrictMode>
    <MovieList />
